een goeie film

met Dennis Quaid, Matthew Fox en William Hurt

In vijf verschillende segmenten die vijf verschillende visies op de gebeurtenissen weergeven, wordt een poging tot aanslag op de 
Amerikaanse president in Spanje gevolgd. Een toerist weet de mogelijke terrorist op video vast te leggen, waarna er door 
veiligheidsdiensten een reeks maatregelen genomen moet worden.
